Please note that this question asks about constant currency revenues for each region rather than headline revenues. For example, in its Q3 2025 [earnings release](https://s206.q4cdn.com/479360582/files/doc_financials/2025/q3/2025q3-alphabet-earnings-release.pdf) Alphabet reports \$29.911 billion in revenues in EMEA but constant currency revenues of \$28.65 billion. The latter number is the relevant figure for resolution purposes.&#x20;

According to Alphabet in its 2024 [annual report](https://s206.q4cdn.com/479360582/files/doc_financials/2025/q4/2024-annual-report.pdf) on page 62:&#x20;

> Regions represent Europe, the Middle East, and Africa (EMEA); Asia-Pacific (APAC); and Canada and Latin America ("Other Americas").&#x20;

If Alphabet changes the methodology of its regions such that the revenues for the options listed cannot be unambiguously calculated, then this question will be **annulled**.&#x20;

Alphabet says on page 34 of its 2024 annual report:

> We define constant currency revenues as revenues excluding the effect of foreign currency exchange rate movements (“FX Effect”) as well as hedging activities, which are recognized at the consolidated level.&#x20;

If Alphabet makes material changes to this definition as judged by Metaculus, the question may be **annulled**.&#x20;

